textOriginal:
É uma festa onde creditava-se que nesse dia os mortos se levantavam e se apoderavam dos corpos dos vivos, por esse motivo, eram usadas fantasias e a festa era repleta de artefatos sombrios com o intuito principal de se defenderem desses maus espíritos, então comemora-se o “Dia das Bruxas” 😔 ISSO É MALIGNIDADE.

(Deuteronômio 18:9-12)
Quando entrares na terra que o Senhor teu Deus te der, não aprenderás a fazer conforme as abominações daquelas nações.
Entre ti não se achará quem faça passar pelo fogo a seu filho ou a sua filha, nem adivinhador, nem prognosticador, nem agoureiro, nem feiticeiro;
Nem encantador, nem quem consulte a um espírito adivinhador, nem mágico, nem quem consulte os mortos;
Pois todo aquele que faz tal coisa é abominação ao Senhor; e por estas abominações o Senhor teu Deus os lança fora de diante de ti.
